import React, { useState } from "react";
import { Link } from "react-router-dom";

function LoginPage() {
    const [formData, setFormData] = useState({
        email: "",
        profession: "Admin",
        password: "",
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Form submitted:", formData);
    };

    return (
        <div style={styles.page}>
            <div style={styles.card}>
                <h1 style={styles.title}>Connexion</h1>
                <p style={styles.subtitle}>Accédez à vos données avec style</p>

                <form onSubmit={handleSubmit} style={styles.form}>
                    {/* Email Field */}
                    <div style={styles.formGroup}>
                        <label htmlFor="email" style={styles.label}>Email :</label>
                        <input
                            type="email"
                            id="email"
                            name="email"
                            value={formData.email}
                            onChange={handleChange}
                            required
                            style={styles.input}
                        />
                    </div>

                    {/* Profession Field */}
                    <div style={styles.formGroup}>
                        <label htmlFor="profession" style={styles.label}>Profession :</label>
                        <select
                            id="profession"
                            name="profession"
                            value={formData.profession}
                            onChange={handleChange}
                            required
                            style={styles.select}
                        >
                            <option value="Admin">Admin</option>
                            <option value="Doctor">Doctor</option>
                            <option value="Patient">Patient</option>
                        </select>
                    </div>

                    {/* Password Field */}
                    <div style={styles.formGroup}>
                        <label htmlFor="password" style={styles.label}>Mot de passe :</label>
                        <input
                            type="password"
                            id="password"
                            name="password"
                            value={formData.password}
                            onChange={handleChange}
                            required
                            style={styles.input}
                        />
                    </div>

                    {/* Links */}
                    <div style={styles.links}>
                        <Link to="/forgot-password" style={styles.link}>Mot de passe oublié ?</Link>
                        <Link to="/signup" style={styles.link}>Créer un compte</Link>
                    </div>

                    {/* Submit Button */}
                    <button type="submit" style={styles.button}>Se connecter</button>
                </form>
            </div>
        </div>
    );
}

const styles = {
    page: {
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        minHeight: "100vh",
        backgroundColor: "#1a1a1a", // Fond noir élégant
        padding: "20px",
    },
    card: {
        backgroundColor: "#fff",
        borderRadius: "10px",
        padding: "40px",
        boxShadow: "0 4px 10px rgba(0, 0, 0, 0.3)",
        maxWidth: "400px",
        width: "100%",
        textAlign: "center",
    },
    title: {
        fontSize: "32px",
        marginBottom: "10px",
        color: "#333",
        fontFamily: "'Poppins', sans-serif",
    },
    subtitle: {
        fontSize: "16px",
        marginBottom: "30px",
        color: "#888",
    },
    form: {
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
    },
    formGroup: {
        marginBottom: "20px",
        width: "100%",
    },
    label: {
        display: "block",
        marginBottom: "5px",
        fontSize: "14px",
        color: "#333",
        fontWeight: "bold",
    },
    input: {
        width: "100%",
        padding: "10px",
        fontSize: "16px",
        borderRadius: "5px",
        border: "1px solid #ccc",
        transition: "border-color 0.3s",
        outline: "none",
    },
    select: {
        width: "100%",
        padding: "10px",
        fontSize: "16px",
        borderRadius: "5px",
        border: "1px solid #ccc",
        transition: "border-color 0.3s",
        outline: "none",
    },
    inputFocus: {
        borderColor: "#d4af37",
    },
    links: {
        display: "flex",
        justifyContent: "space-between",
        width: "100%",
        marginBottom: "20px",
    },
    link: {
        textDecoration: "none",
        fontSize: "14px",
        color: "#d4af37", // Couleur dorée
        fontWeight: "bold",
    },
    button: {
        padding: "10px 20px",
        fontSize: "16px",
        color: "#fff",
        backgroundColor: "#d4af37", // Bouton doré
        border: "none",
        borderRadius: "5px",
        cursor: "pointer",
        transition: "background-color 0.3s",
    },
    buttonHover: {
        backgroundColor: "#b8962e", // Couleur dorée plus sombre au survol
    },
};

export default LoginPage;
